import { BrowserRouter, Routes, Route, Link } from "react-router-dom";
import './Navigation.css'

export default function Navigation() {
	return (
		<BrowserRouter>
			<div>
				<div className='nav'>
					<h4 className='item'>Home</h4>
					<h4 className='item'>Menu</h4>
					<h4 className='item'>User</h4>
				</div>
			</div>
		</BrowserRouter>
	  );
}

function Home() {
	return <h4>Home</h4>;
}

function Menu() {
	return <h4>Menu</h4>;
}

function User() {
	return <h4>User</h4>;
}
